BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" (
	"id"	integer NOT NULL,
	"app"	varchar(255) NOT NULL,
	"name"	varchar(255) NOT NULL,
	"applied"	datetime NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" (
	"id"	integer NOT NULL,
	"group_id"	integer NOT NULL,
	"permission_id"	integer NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("group_id") REFERENCES "auth_group"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("permission_id") REFERENCES "auth_permission"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "auth_user_groups" (
	"id"	integer NOT NULL,
	"user_id"	integer NOT NULL,
	"group_id"	integer NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("user_id") REFERENCES "auth_user"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("group_id") REFERENCES "auth_group"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" (
	"id"	integer NOT NULL,
	"user_id"	integer NOT NULL,
	"permission_id"	integer NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("user_id") REFERENCES "auth_user"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("permission_id") REFERENCES "auth_permission"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "accounts_division" (
	"divisionCode"	varchar(20),
	"divisionName"	varchar(100),
	"companyLogo"	varchar(100),
	"regNumber"	varchar(30),
	"vatNumber"	varchar(30),
	"address1"	varchar(50),
	"address2"	varchar(50),
	"city"	varchar(50),
	"province"	varchar(50),
	"country"	varchar(200),
	"contactNumber"	varchar(50),
	"webSite"	varchar(150),
	"id"	char(32) NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "accounts_resource" (
	"resourceID"	varchar(15) UNIQUE,
	"resourceName"	varchar(50),
	"easyRate"	decimal NOT NULL,
	"averageRate"	decimal NOT NULL,
	"complexRate"	decimal NOT NULL,
	"id"	char(32) NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "accounts_teammember" (
	"phoneNumber"	varchar(15) NOT NULL,
	"companyName"	varchar(50),
	"id"	char(32) NOT NULL,
	"designation_id"	char(32) NOT NULL,
	"user_id"	integer NOT NULL UNIQUE,
	PRIMARY KEY("id"),
	FOREIGN KEY("user_id") REFERENCES "auth_user"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("designation_id") REFERENCES "accounts_resource"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "django_content_type" (
	"id"	integer NOT NULL,
	"app_label"	varchar(100) NOT NULL,
	"model"	varchar(100) NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "auth_permission" (
	"id"	integer NOT NULL,
	"content_type_id"	integer NOT NULL,
	"codename"	varchar(100) NOT NULL,
	"name"	varchar(255) NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("content_type_id") REFERENCES "django_content_type"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "auth_group" (
	"id"	integer NOT NULL,
	"name"	varchar(150) NOT NULL UNIQUE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "auth_user" (
	"id"	integer NOT NULL,
	"password"	varchar(128) NOT NULL,
	"last_login"	datetime,
	"is_superuser"	bool NOT NULL,
	"username"	varchar(150) NOT NULL UNIQUE,
	"last_name"	varchar(150) NOT NULL,
	"email"	varchar(254) NOT NULL,
	"is_staff"	bool NOT NULL,
	"is_active"	bool NOT NULL,
	"date_joined"	datetime NOT NULL,
	"first_name"	varchar(150) NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "quotations_designactivity" (
	"itemCode"	varchar(15) UNIQUE,
	"itemDescrp"	varchar(200),
	"id"	char(32) NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "quotations_discipline" (
	"Code"	varchar(2),
	"Description"	varchar(50),
	"id"	char(32) NOT NULL,
	"WBS_id"	char(32),
	PRIMARY KEY("id"),
	FOREIGN KEY("WBS_id") REFERENCES "quotations_projectstructure"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "quotations_docsubitem" (
	"Code"	varchar(6) UNIQUE,
	"Description"	varchar(50),
	"WBS"	varchar(3),
	"id"	char(32) NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "quotations_documentstatus" (
	"Code"	varchar(5) UNIQUE,
	"Status"	varchar(60),
	"id"	char(32) NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "quotations_itemcode" (
	"itemCode"	varchar(15) UNIQUE,
	"itemDescrp"	varchar(200),
	"id"	char(32) NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "quotations_materialcategory" (
	"itemCode"	varchar(15) UNIQUE,
	"itemDescrp"	varchar(200),
	"id"	char(32) NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "quotations_projectstructure" (
	"Code"	varchar(15) UNIQUE,
	"Description"	varchar(50),
	"WBS"	varchar(6),
	"id"	char(32) NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "quotations_projectsubstructure" (
	"Code"	varchar(15) UNIQUE,
	"Description"	varchar(50),
	"WBS"	varchar(6),
	"id"	char(32) NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "quotations_purchasecategory" (
	"Code"	varchar(5) UNIQUE,
	"Category"	varchar(60),
	"id"	char(32) NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "quotations_scopeofwork" (
	"quoteNumber"	varchar(15) NOT NULL UNIQUE,
	"id"	char(32) NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "quotations_supplycategory" (
	"itemCode"	varchar(15) UNIQUE,
	"category"	varchar(200),
	"id"	char(32) NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "quotations_supportactivity" (
	"itemCode"	varchar(15) UNIQUE,
	"itemDescrp"	varchar(200),
	"id"	char(32) NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "quotations_supplyquotation" (
	"activityDescr"	varchar(200),
	"supplierRef"	varchar(200),
	"handFee"	decimal NOT NULL,
	"quantity"	integer NOT NULL,
	"unitsOfMeasure"	varchar(20),
	"unitCost"	decimal,
	"markupMargin"	decimal NOT NULL,
	"supplierDisc"	decimal NOT NULL,
	"subTotalValue"	decimal,
	"id"	char(32) NOT NULL,
	"itemCode_id"	char(32) NOT NULL,
	"materialCode_id"	char(32) NOT NULL,
	"quoteNumber_id"	char(32),
	"supplier_id"	char(32) NOT NULL,
	FOREIGN KEY("materialCode_id") REFERENCES "quotations_supplycategory"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("itemCode_id") REFERENCES "quotations_itemcode"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("quoteNumber_id") REFERENCES "quotations_scopeofwork"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id"),
	FOREIGN KEY("supplier_id") REFERENCES "accounts_company"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "quotations_scopeofworkinclusions" (
	"itemCode"	varchar(10) NOT NULL,
	"inclusion"	varchar(2000),
	"quantity"	integer,
	"units"	varchar(10),
	"delivery_time"	integer,
	"id"	char(32) NOT NULL,
	"quoteNumber_id"	char(32) NOT NULL,
	PRIMARY KEY("id"),
	FOREIGN KEY("quoteNumber_id") REFERENCES "quotations_scopeofwork"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "quotations_scopeofworkexclusion" (
	"itemCode"	varchar(10) NOT NULL,
	"exclusion"	varchar(2000),
	"id"	char(32) NOT NULL,
	"quoteNumber_id"	char(32),
	PRIMARY KEY("id"),
	FOREIGN KEY("quoteNumber_id") REFERENCES "quotations_scopeofwork"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "quotations_quotation" (
	"project"	varchar(15) UNIQUE,
	"description"	varchar(300),
	"division"	varchar(20),
	"date_created"	date,
	"quote_status"	varchar(20) NOT NULL,
	"delivery"	varchar(15),
	"delivery_details"	varchar(150),
	"quote_validity"	varchar(300),
	"payment_terms"	varchar(300),
	"id"	char(32) NOT NULL,
	"clientName_id"	char(32),
	"companyName_id"	char(32),
	"compiler_id"	char(32),
	PRIMARY KEY("id"),
	FOREIGN KEY("compiler_id") REFERENCES "accounts_teammember"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("companyName_id") REFERENCES "accounts_company"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("clientName_id") REFERENCES "accounts_contact"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "quotations_documenttype" (
	"Code"	varchar(3) UNIQUE,
	"Description"	varchar(60),
	"id"	char(32) NOT NULL,
	"WBS_id"	char(32),
	PRIMARY KEY("id"),
	FOREIGN KEY("WBS_id") REFERENCES "quotations_docsubitem"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "quotations_designquotation" (
	"activityDescr"	varchar(200),
	"complexity"	varchar(20),
	"estHours"	integer NOT NULL,
	"actualHours"	integer,
	"unitCost"	decimal,
	"markupMargin"	decimal NOT NULL,
	"subTotalValue"	decimal,
	"id"	char(32) NOT NULL,
	"activity_id"	char(32) NOT NULL,
	"discipline_id"	char(32) NOT NULL,
	"itemCode_id"	char(32) NOT NULL,
	"quoteNumber_id"	char(32),
	"resource_id"	char(32) NOT NULL,
	PRIMARY KEY("id"),
	FOREIGN KEY("itemCode_id") REFERENCES "quotations_itemcode"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("activity_id") REFERENCES "quotations_designactivity"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("quoteNumber_id") REFERENCES "quotations_scopeofwork"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("resource_id") REFERENCES "accounts_resource"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("discipline_id") REFERENCES "quotations_discipline"("id") DEFERRABLE INITIALLY DEFERRED
);
